a:18:{s:4:"name";s:6:"Motrin";s:11:"small_descr";s:124:"Motrin is a nonsteroidal anti-inflammatory agent with analgesic properties used in the therapy of rheumatism and arthritis. ";s:14:"small_descr_de";s:144:"Motrin ist ein nichtsteroidalen Antirheumatika mit analgetischen Eigenschaften und wird zur Behandlung von Rheumatism und Arthritis angewendet. ";s:14:"small_descr_fr";s:134:"Motrin est un medicament anti-inflammatoire avec des propriétés analgésiques utilisé dans le traitement de rhumatisme et arthrite.";s:14:"small_descr_es";s:139:"Motrin es un medicamento antiinflamatorio, no esteroideo con propiedades analgésicas utilizado en la terapia del reumatismo y la artritis.";s:14:"small_descr_it";s:131:"Motrin è un farmaco anti-infiammatorio non steroide (FANS) con l'effetto analgesico, usato per trattare il reumatismo e l'artrite.";s:10:"full_descr";s:7506:"<p><strong>INDICATIONS </strong></p><p>Motrin is used for treating rheumatoid arthritis, osteoarthritis, menstrual cramps, or mild to moderate pain. Motrin is an NSAID. NSAIDs treat the symptoms of pain and inflammation. They do not treat the disease that causes those symptoms.</p><p><strong>INSTRUCTIONS&nbsp;</strong></p><p>Use Motrin as directed by your doctor.</p><ul><li>Take Motrin by mouth with or without food. It may be taken with food if it upsets your stomach. Taking it with food may not lower the risk of stomach or bowel problems (eg, bleeding, ulcers). Talk with your doctor or pharmacist if you have persistent stomach upset.</li><li>Take Motrin with a full glass of water (8 oz/240 mL) as directed by your doctor.</li><li>If you miss a dose of Motrin and you are taking it regularly, take it as soon as possible. If it is almost time for your next dose, skip the missed dose. Go back to your regular dosing schedule. Do not take 2 doses at once.</li></ul><p>Ask your health care provider any questions you may have about the proper use of Motrin .</p><p><strong>STORAGE</strong></p><p>Store Motrin at room temperature, between 68 and 77 degrees F (20 and 25 degrees C). Store away from heat, moisture, and light. Do not store in the bathroom. Keep Motrin out of the reach of children and away from pets.</p><p><strong>MORE INFO:</strong></p><p>Active Ingredient: Ibuprofen.</p><p><strong>SAFETY INFORMATION</strong></p><h3>Do NOT use Motrin if:</h3>
<ul>
<li>you are allergic to any ingredient in Motrin </li>
<li>you have had a severe allergic reaction (eg, severe rash, hives, trouble breathing, growths in the nose, dizziness) to aspirin or an NSAID (eg, ibuprofen, celecoxib)</li>
<li>you have recently had or will be having bypass heart surgery</li>
<li>you are in the last 3 months of pregnancy.</li>
</ul>
<p>Contact your doctor or health care provider right away if any of these apply to you.</p>
<p>Some medical conditions may interact with Motrin. Tell your doctor or pharmacist if you have any medical conditions, especially if any of the following apply to you:</p>
<ul>
<li>if you are pregnant, planning to become pregnant, or are breast-feeding</li>
<li>if you are taking any prescription or nonprescription medicine, herbal product, or dietary supplement</li>
<li>if you have allergies to medicines, foods, or other substances</li>
<li>if you have a history of kidney or liver disease, diabetes, or stomach or bowel problems (eg, bleeding, perforation, ulcers)</li>
<li>if you have a history of swelling or fluid buildup, lupus, asthma, or growths in the nose (nasal polyps), or mouth inflammation</li>
<li>if you have high blood pressure, blood disorders, bleeding or clotting problems, heart problems (eg, heart failure), or blood vessel disease, or if you are at risk for any of these diseases</li>
<li>if you have poor health, dehydration or low fluid volume, or low blood sodium levels, you drink alcohol, or you have a history of alcohol abuse.</li>
</ul>
<p>Some medicines may interact with Motrin. Tell your health care provider if you are taking any other medicines, especially any of the following:</p>
<ul>
<li>Anticoagulants (eg, warfarin), aspirin, corticosteroids (eg, prednisone), heparin, or selective serotonin reuptake inhibitors (SSRIs) (eg, fluoxetine) because the risk of stomach bleeding may be increased</li>
<li>Probenecid because it may increase the risk of Motrin 's side effects</li>
<li>Cyclosporine, lithium, methotrexate, or quinolones (eg, ciprofloxacin) because the risk of their side effects may be increased by Motrin </li>
<li>Angiotensin-converting enzyme (ACE) inhibitors (eg, enalapril) or diuretics (eg, furosemide, hydrochlorothiazide) because their effectiveness may be decreased by Motrin. </li>
</ul>
<p>This may not be a complete list of all interactions that may occur. Ask your health care provider if Motrin may interact with other medicines that you take. Check with your health care provider before you start, stop, or change the dose of any medicine.</p>
<h3>Important safety information:</h3>
<ul>
<li>Motrin may cause dizziness or drowsiness. These effects may be worse if you take it with alcohol or certain medicines. Use Motrin with caution. Do not drive or perform other possible unsafe tasks until you know how you react to it.</li>
<li>Serious stomach ulcers or bleeding can occur with the use of Motrin . Taking it in high doses or for a long time, smoking, or drinking alcohol increases the risk of these side effects. Taking Motrin with food will NOT reduce the risk of these effects. Contact your doctor or emergency room at once if you develop severe stomach or back pain; black, tarry stools; vomit that looks like blood or coffee grounds; or unusual weight gain or swelling.</li>
<li>Do not take more than the recommended dose or use for longer than prescribed without checking with your doctor.</li>
<li>Motrin has ibuprofen in it. Before you start any new medicine, check the label to see if it has ibuprofen in it too. If it does or if you are not sure, check with your doctor or pharmacist.</li>
<li>Do not take aspirin while you are using Motrin unless your doctor tells you to.</li>
<li>Lab tests, including kidney function, complete blood cell counts, and blood pressure, may be done to monitor your progress or to check for side effects. Be sure to keep all doctor and lab appointments.</li>
<li>Use Motrin with caution in the elderly; they may be more sensitive to its effects, including stomach bleeding and kidney problems.</li>
<li>Motrin should be used with extreme caution in children; safety and effectiveness in children have not been confirmed.</li>
<li>Pregnancy and breast-feeding: Motrin may cause harm to the fetus. Do not take it during the last 3 months of pregnancy. If you think you may be pregnant, contact your doctor. You will need to discuss the benefits and risks of taking Motrin while you are pregnant. It is not known if Motrin is found in breast milk. Do not breastfeed while taking Motrin .</li>
</ul><p><strong>SIDE EFFECTS</strong></p><p>All medicines can cause side effects, but many people have no, or minor, side effects.</p>
<p>Check with your doctor if any of these most common side effects persist or become bothersome:</p>
<p>Constipation; diarrhea; dizziness; gas; headache; heartburn; nausea; stomach pain or upset.</p>
<p>Seek medical attention right away if any of these severe side effects occur:</p>
<p>Severe allergic reactions (rash; hives; itching; trouble breathing; tightness in the chest; swelling of the mouth, face, lips, or tongue); bloody or black, tarry stools; change in the amount of urine produced; chest pain; confusion; dark urine; depression; fainting; fast or irregular heartbeat; fever, chills, or persistent sore throat; mental or mood changes; numbness of an arm or leg; one-sided weakness; red, swollen, blistered, or peeling skin; ringing in the ears; seizures; severe headache or dizziness; severe or persistent stomach pain or nausea; severe vomiting; shortness of breath; stiff neck; sudden or unexplained weight gain; swelling of hands, legs, or feet; unusual bruising or bleeding; unusual joint or muscle pain; unusual tiredness or weakness; vision or speech changes; vomit that looks like coffee grounds; yellowing of the skin or eyes.</p>
<p>This is not a complete list of all side effects that may occur. If you have questions about side effects, contact your health care provider.</p>";s:13:"full_descr_de";s:0:"";s:13:"full_descr_fr";s:0:"";s:13:"full_descr_es";s:0:"";s:13:"full_descr_it";s:0:"";s:9:"min_price";s:8:"0.784784";s:9:"pack_name";s:5:"pills";s:4:"type";s:2:"mg";s:7:"analogs";N;s:8:"synonims";a:467:{i:0;s:4:"Urem";i:1;s:5:"Upren";i:2;s:5:"Upfen";i:3;s:7:"Unipron";i:4;s:9:"Uniprofen";i:5;s:8:"Trosifen";i:6;s:8:"Tussamag";i:7;s:7:"Trifene";i:8;s:8:"Tricalma";i:9;s:10:"Tri-profen";i:10;s:13:"Trauma-dolgit";i:11;s:5:"Tonal";i:12;s:7:"Togal n";i:13;s:13:"Tispol ibu-dd";i:14;s:10:"Thermoflam";i:15;s:6:"Termyl";i:16;s:10:"Termalfeno";i:17;s:8:"Terbofen";i:18;s:6:"Teprix";i:19;s:8:"Tenvalin";i:20;s:7:"Tatanol";i:21;s:7:"Tabalon";i:22;s:8:"Suprafen";i:23;s:13:"Sudafed sinus";i:24;s:8:"Subitene";i:25;s:8:"Subheron";i:26;s:7:"Staderm";i:27;s:6:"Spifen";i:28;s:8:"Spidufen";i:29;s:8:"Spidifen";i:30;s:8:"Spedifen";i:31;s:7:"Solufen";i:32;s:7:"Solvium";i:33;s:9:"Solpaflex";i:34;s:6:"Smadol";i:35;s:7:"Siyafen";i:36;s:11:"Sine-aid ib";i:37;s:6:"Sindol";i:38;s:6:"Siflam";i:39;s:11:"Serviprofen";i:40;s:6:"Sconin";i:41;s:14:"Schmerz-dolgit";i:42;s:8:"Sarixell";i:43;s:7:"Sapofen";i:44;s:8:"Sapbufen";i:45;s:7:"Salivia";i:46;s:7:"Saldeva";i:47;s:6:"Saetil";i:48;s:5:"Rupan";i:49;s:5:"Rufen";i:50;s:14:"Robax platinum";i:51;s:7:"Rimofen";i:52;s:7:"Ribunal";i:53;s:8:"Rhelafen";i:54;s:9:"Reuprofen";i:55;s:6:"Reufen";i:56;s:9:"Reprexain";i:57;s:7:"Renidon";i:58;s:7:"Rebufen";i:59;s:7:"Remofen";i:60;s:10:"Ratiodolor";i:61;s:8:"Ratiodol";i:62;s:6:"Ranfen";i:63;s:5:"Rafen";i:64;s:8:"Quimoral";i:65;s:7:"Quadrax";i:66;s:7:"Pyriped";i:67;s:10:"Pymeprofen";i:68;s:6:"Provin";i:69;s:6:"Provon";i:70;s:8:"Prosinal";i:71;s:6:"Proris";i:72;s:7:"Proflex";i:73;s:8:"Profinal";i:74;s:6:"Profen";i:75;s:8:"Probinex";i:76;s:11:"Ponstinetas";i:77;s:7:"Ponstin";i:78;s:13:"Ponstil mujer";i:79;s:7:"Ponstil";i:80;s:7:"Pironal";i:81;s:7:"Pirexi